import React from "react";
import logo from "../../../src/img/FullLogo.png";
const Landing = () => {
  return (
    <div>
      <img className="fullLogo" src={logo} alt="Logo" />
      <h1 className="welcomeMsg"> Welcome to Receipt & Expense </h1>
    </div>
  );
};

export default Landing;
